import React from "react";
import "style.css";

function Jumbotron() {
    return (
        <div>
            <div className="jumbotron jumbotron-fluid">
                <div className="container">
                    <h1 className="text-center text-white">Book Search</h1>
                    <p className="lead text-center text-white">Search for a book you are interested in.</p>
                </div>
            </div>
        </div>
    );
}

export default Jumbotron;
